script: |
  super -f text -I q1734.spq | sort > q1734.out

inputs:
  - name: q1734.spq
    data: |
      SELECT - col0 / 62 + + col2 FROM tab2 (FORMAT parquet) WHERE ( 8 ) NOT BETWEEN col0 + col1 AND col1 - + col2 * - 12;
  - name: tab2

outputs:
  - name: q1734.out
    data: |
      23
      39
      57
